import React, { FC, MouseEventHandler } from 'react';

type btnType = "default"| "positive"| "negative";

interface MyButtonProps {
    text: string;
    type?: btnType;
    onClick?: MouseEventHandler<HTMLButtonElement>;
}

const MyButton: FC<MyButtonProps> = ({ text, type='default', onClick }) => {

    const validTypes: btnType[] = ['default', 'positive', 'negative'];
    const resolvedType: btnType = validTypes.includes(type) ? type : 'default';

    return (
        <button className={["MyButton", `MyButton_${resolvedType}`].join(" ")} onClick={onClick}>
            {text}
        </button>
    );
};

MyButton.defaultProps = {
    type: "default",
};

export default MyButton;
